<ul>
<li>Romaniza\xE7\xE3o dos nomes segue padr\xE3o do MyAnimeList. Provavelmente o grupo ou preferiu seguir o estilo dos nomes que aparece escrito no anime ou preferiu seguir o estilo de algum servi\xE7o de streaming. Em qualquer caso, provavelmente \xE9 melhor deixar as vogais longas marcadas igual ao MAL ao inv\xE9s de ignor\xE1-las.</li>
<li>Redu\xE7\xE3o de quebras de linha. No epis\xF3dio 13 adiante o grupo colocou quebras de linha em falas curtas, diminuindo a legibilidade. Imagino que tenham usado alguma ferramenta para colocar quebras de linha automaticamente mal configurada.</li>
<li>Melhoria de quebras de linha. Algumas quebras de linha foram reposicionadas para evitar palavras isoladas entre pontua\xE7\xE3o e a quebra de linha, melhorando a legibilidade.</li>
<li>Remove espa\xE7os duplicados.</li>
<li>Corrige erros de gram\xE1tica e digita\xE7\xE3o.</li>
<li>Corrige tradu\xE7\xF5es de \u30A2\u30E1\u30EA\u30AB: em alguns epis\xF3dios foi traduzido para &quot;Am\xE9rica&quot;, em outros &quot;EUA&quot;. A segunda tradu\xE7\xE3o foi escolhida como correta.</li>
<li>Corrige express\xE3o estranha no epis\xF3dio 6 em 15:06: parece que traduziram literalmente do ingl\xEAs e a frase n\xE3o ficou muito boa em portugu\xEAs. A fala em japon\xEAs \xE9 &quot;\u304A\u6B63\u6708\u307E\u3067&quot; ent\xE3o seria algo pr\xF3ximo de &quot;at\xE9 o ano novo&quot;. N\xE3o acredito que &quot;antes do ano chegar muito longe&quot; passe o mesmo sentido.</li>
<li>Corrige erro de tradu\xE7\xE3o no epis\xF3dio 8 em 09:12: a fala em ingl\xEAs &quot;it&#39;s you&quot;, n\xE3o sei como entenderam como &quot;it&#39;s about you&quot;.</li>
<li>Corrige uso inconsistente de honor\xEDficos.</li>
<li>Corrige tradu\xE7\xE3o errada da m\xFAsica no epis\xF3dio 21. A tradu\xE7\xE3o dos grupos Ichiban e Lolisub foi usada no lugar. A estiliza\xE7\xE3o e a o estilo de tradu\xE7\xE3o foram adaptados.</li>
<li>Adiciona tradu\xE7\xF5es dos textos no epis\xF3dio 5 em 17:02 usando a tradu\xE7\xE3o dos grupos Ichiban e Lolisub como base. Novamente, a estiliza\xE7\xE3o e a o estilo de tradu\xE7\xE3o foram adaptados.</li>
<li>Adiciona tradu\xE7\xE3o do texto no epis\xF3dio 17 em 03:33 usando uma estiliza\xE7\xE3o b\xE1sica.</li>
<li>Adiciona tradu\xE7\xF5es dos t\xEDtulos das pr\xE9vias (adicionadas nos Blu-rays).</li>
</ul>
